import React from 'react';
import Logo from '../img/Header/logo.svg';
import Socials from './Socials';
import MobileNav from './MobileNav';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header className=' bg-pink-200 fixed w-full px-
    [30px] lg:px-[100px] z-30 h-[100px] lg:h-[140px] flex
    items-center'>
      <div className='flex flex-col 
      lg:flex-row lg:items-center w-full justify-between'>
        {/* logo */}
        <Link to={'/'}>
          <img src={Logo} alt='' />
          </Link>
          {/* nav - initially hidden - show on desktop mode */}
          <nav className='hidden ig:flex'>
          <Link
            to={'/'}
            className='text-[#696c6d] hover:text-primary transition'
          >
            Home
          </Link>
          <Link
            to={'/about'}
            className='text-[#696c6d] hover:text-primary transition'
          >
            About
          </Link>
          <Link
            to={'/portfolio'}
            className='text-[#696c6d] hover:text-primary transition'
          >
            Porftolio
          </Link>
          <Link
            to={'/contact'}
            className='text-[#696c6d] hover:text-primary transition'
          >
            Contact
          </Link>
            </nav>
         </div>
      </header>
  );
};

export default Header;
